import React from 'react';
import { UserProfile } from '../types/auth';
import { authService } from '../lib/auth';

interface HeaderProps {
  user: UserProfile | null;
  onLogout: () => void;
}

const Header: React.FC<HeaderProps> = ({ user, onLogout }) => {
  const handleLogout = async () => {
    try {
      await authService.signOut();
      onLogout();
    } catch (error) {
      console.error('Erro ao fazer logout:', error);
    }
  };

  return (
    <header className="bg-[#2d2d2d] border-b border-[#404040] py-4">
      <div className="container mx-auto px-4 flex justify-between items-center">
        <h1 className="text-[#e1aa1e] text-xl font-semibold">Audio Player</h1>
        
        {user && (
          <div className="flex items-center gap-4">
            <span className="text-gray-300">
              Ol√°, {user.full_name}
            </span>
            <button
              onClick={handleLogout}
              className="px-3 py-1.5 text-sm bg-[#404040] text-gray-300 rounded hover:bg-[#505050] transition-colors"
            >
              Sair
            </button>
          </div>
        )}
      </div>
    </header>
  );
};

export default Header;
